import React from 'react';
import './Product.css';
function Product({title, image}) {
  return <div className='product'>
      <div className='product__info'>
          <p>{title}</p>
      </div>

      <img src={image} alt=''/>
       
      <button>Add Product</button>
  </div>;
}

export default Product;
